  false,\n\t\"url\": null,\n\t\"notes\": \"The Bon Secour National Wildlife Refuge
  Habitat Management Plan provides a long-term vision and specific guidance on managing
  habitats for the resources of concern at Bon Secour, to facilitate continuity in
  management programs. Refuge background, resources of concern, and habitat management
  goals and objectives are discussed. Management strategies and prescriptions then
  identify how and the specific means by which management and monitoring strategies
  will be implemented. Appendices follow.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
